import React from "react";
import "./styles.css";

export default function App() {
  return (
    <div>
      <Sum valueA={1} valueB={2} />;
    </div>
  );
}

function Sum({ valueA, valueB }) {
  <div>
    <h1>
      {valueA} + {valueB} = {valueA + valueB}{" "}
    </h1>
  </div>;
}
